class Solution {
public:
    long long maximumValueSum(vector<vector<int>>& board) {
        vector<vector<int>> v;
        int n=board.size(),m=board[0].size();
        for(int i=0;i<n;i++)
        {
            for(int j=0;j<m;j++)
            {
                v.push_back({board[i][j],i,j});
            }
        }
        sort(v.rbegin(),v.rend());
        int it=min(300,n*m);
        long long ans=-1e18;
        for(int i=0;i<10;i++)
        {
            for(int j=i+1;j<it;j++)
            {
                for(int k=j+1;k<it;k++)
                {
                    if(v[i][1]!=v[j][1] and v[i][1]!=v[k][1] and v[j][1]!=v[k][1] and v[i][2]!=v[j][2] and v[i][2]!=v[k][2] and v[j][2]!=v[k][2])
                    {
                        long long curr=v[i][0];
                        curr+=v[j][0];
                        curr+=v[k][0];
                        ans=max(ans,curr);
                    }
                }
            }
        }
        return ans;
    }
};
